to, calidez y cordialidad a los usuarios y consumidores.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,506,7,'LEYENDA_FACTURA','Ley N° 453: Tienes derecho a un trato equitativo sin discriminación en la oferta de servicios.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,507,8,'LEYENDA_FACTURA','Ley N° 453: El proveedor de productos debe habilitar medios e instrumentos para efectuar consultas y reclamaciones.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,508,9,'LEYENDA_FACTURA','Ley N° 453: Está prohibido importar, distribuir o comercializar productos expirados o prontos a expirar.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,509,10,'LEYENDA_FACTURA','Ley N° 453: Los contratos de adhesión deben redactarse en términos claros, comprensibles, legibles y deben informar todas las facilidades y limitaciones.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,510,11,'LEYENDA_FACTURA','Ley N° 453: Si se te ha vulnerado algún derecho puedes exigir la reposición o restauración.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,511,12,'LEYENDA_FACTURA','Ley N° 453: Las publicaciones, mensajes e imágenes no deben promover la sumisión o explotación de las mujeres.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,512,13,'LEYENDA_FACTURA','Ley N° 453: Tienes derecho a recibir información que te proteja de la publicidad engañosa.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,513,14,'LEYENDA_FACTURA','Ley N° 453: En caso de incumplimiento a lo ofertado o convenido, el proveedor debe reparar o sustituir el servicio.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,514,15,'LEYENDA_FACTURA','Ley N° 453: El proveedor debe exhibir certificaciones de habilitación o documentos que acrediten las capacidades u ofertas de servicios especializados.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,515,16,'LEYENDA_FACTURA','Ley N° 453: Las publicaciones, mensajes e imágenes no deben deshonrar y atentar contra la dignidad e imagen de la mujer'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,516,17,'LEYENDA_FACTURA','Ley N° 453: Los alimentos declarados de primera necesidad deben ser suministrados de manera adecuada, oportuna, continua y a precio justo.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,517,18,'LEYENDA_FACTURA','Ley N° 453: Se debe promover el consumo solidario, justo, en armonía con la Madre Tierra y precautelando el hábitat, en el marco del Vivir Bien.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,518,19,'LEYENDA_FACTURA','Ley N° 453: Tienes derecho a recibir información sobre las características y contenidos de los servicios que utilices.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,519,20,'LEYENDA_FACTURA','Ley N° 453: El proveedor deberá dar cumplimiento a las condiciones ofertadas.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,520,21,'LEYENDA_FACTURA','Ley N° 453: Tienes derecho a recibir información sobre las características y contenidos de los productos que consumes.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,521,22,'LEYENDA_FACTURA','Ley N° 453: Tienes derecho a un trato equitativo sin discriminación en la oferta de productos.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,522,23,'LEYENDA_FACTURA','Ley N° 453: En caso de incumplimiento a lo ofertado o convenido, el proveedor debe reparar o sustituir el servicio..'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,523,24,'LEYENDA_FACTURA','Ley N° 453: Está prohibido importar, distribuir o comercializar productos prohibidos o retirados en el país de origen por atentar a la integridad física y a la salud.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,524,25,'LEYENDA_FACTURA','Ley N° 453: Se debe brindar alternativas de pago por servicios utilizados en emergencia médica u hospitalaria, no pudiendo retenerse al usuario por deuda.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,525,26,'LEYENDA_FACTURA','Ley N° 453: Se debe otorgar el auxilio y atención necesarios en casos de urgencia o emergencia hospitalaria, sin aducir excusa alguna.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,526,27,'LEYENDA_FACTURA','Ley N° 453: Tienes derecho a denunciar la existencia de productos y servicios que pongan en riesgo tu salud o integridad física.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,527,28,'LEYENDA_FACTURA','Ley N° 453: El proveedor de servicios debe habilitar medios e instrumentos para efectuar consultas y reclamaciones.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,528,29,'LEYENDA_FACTURA','Ley N° 453: El proveedor deberá suministrar el servicio en las modalidades y términos ofertados o convenidos.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,529,30,'LEYENDA_FACTURA','Ley N° 453: Están prohibidas las prácticas comerciales abusivas, tienes derecho a denunciarlas.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,530,31,'LEYENDA_FACTURA','Ley N° 453: El proveedor deberá entregar el producto en las modalidades y términos ofertados o convenidos.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,531,32,'LEYENDA_FACTURA','Ley N° 453: La entidad financiera tiene la obligación de promover la educación financiera.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,532,33,'LEYENDA_FACTURA','Ley N° 453: Cuando lo solicite el paciente, se debe informar los resultados de exámenes, diagnósticos y estudios de laboratorio.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,533,34,'LEYENDA_FACTURA','Ley N° 453: En caso de incumplimiento a lo ofertado o convenido, el proveedor debe reparar o sustituir el producto..'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,534,35,'LEYENDA_FACTURA','Ley N° 453: La entidad financiera debe facilitar en cualquier momento y gratuitamente, toda información de los movimientos bancarios, financieros o de crédito. '),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,535,36,'LEYENDA_FACTURA','Ley N° 453: La interrupción del servicio debe comunicarse con anterioridad a las Autoridades que correspondan y a los usuarios afectados.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,536,37,'LEYENDA_FACTURA','Ley N° 453: El prestador de servicio médico debe prescribir medicamentos debidamente autorizados por el Ministerio de Salud.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,537,38,'LEYENDA_FACTURA','Ley N° 453: El prestador de servicio médico debe brindar atención de calidad al paciente.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,538,39,'LEYENDA_FACTURA','Ley N° 453: Los medios de comunicación deben difundir mensajes o programas de educación de consumo responsable y sustentable.'),('2019-08-19 18:26:32',NULL,NULL,'admin',NULL,NULL,539,40,'LEYENDA_FACTURA','Ley N° 453: Los servicios deben suministrarse en condiciones de inocuidad, calidad y seguridad.'),('2019-08-19 18:26:56',NULL,NULL,'admin',NULL,NULL,540,912,'MOTIVO_ANULACION','FACTURA MAL EMITIDA'),('2019-08-19 18:26:56',NULL,NULL,'admin',NULL,NULL,541,913,'MOTIVO_ANULACION','NOTA FISCAL EMITIDA'),('2019-08-19 18:26:56',NULL,NULL,'admin',NULL,NULL,542,914,'MOTIVO_ANULACION','DATOS DE EMISION INCORRECTOS'),('2019-08-19 18:26:56',NULL,NULL,'admin',NULL,NULL,543,915,'MOTIVO_ANULACION','FACTURA O NOTA DEVUELTA'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,544,328,'TIPO_DEPARTAMENTO','LA PAZ'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,545,329,'TIPO_DEPARTAMENTO','COCHABAMBA'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,546,331,'TIPO_DEPARTAMENTO','CHUQUISACA'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,547,332,'TIPO_DEPARTAMENTO','TARIJA'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,548,333,'TIPO_DEPARTAMENTO','ORURO'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,549,334,'TIPO_DEPARTAMENTO','POTOSÍ'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,550,335,'TIPO_DEPARTAMENTO','BENI'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,551,336,'TIPO_DEPARTAMENTO','PANDO'),('2019-08-19 18:27:44',NULL,NULL,'admin',NULL,NULL,552,330,'TIPO_DEPARTAM